properties.DevelopmentDescription:
Alterations and extensions to existing part two storey/part single storey three bedroom terraced dwelling comprising :
(a) Demolition of existing sub-standard single storey extension to rear;   (b) construction of a new part single / part two storey extension to rear with a resultant increase in habitable floor area from 115.2sq.m to 127.8sq.m (additional 3.6 sq.m at ground floor level and 9.0 sq.m at first floor level) and an increase in bedrooms from three to four;   (c) elevational alterations to existing porch to front;
(d) conversion of existing attic space to accessible attic storage with 3 no. new Velux rooflights to rear of main roof;   (e) creation of new vehicular entrance and off street parking in existing front garden and  (f) all associated site works.
